import Banner from "../components/Banner";

export default function Ehime() {
  return (
    <div>
      <Banner
        title="愛媛"
        subtitle="松山城與道後溫泉的和風魅力"
        imageUrl="https://images.unsplash.com/photo-1558706511-159f6631c1db"
      />
      <div className="mt-6 space-y-4 text-gray-700">
        <p>愛媛縣擁有歷史悠久的道後溫泉，是日本最古老的溫泉之一。</p><p>松山城也保留著江戶時代的風貌，是文化愛好者的必訪景點。</p>
      </div>
    </div>
  );
}
